import React from 'react';

const InputStar = (props) => {
  return (
    <React.Fragment>
      <label className='star' htmlFor={`star-${props.index}`}>
        
      <input
        type="radio"
        id={`star-${props.index}`}
        name="rating"
        defaultChecked={props.star === props.index}
        value={props.index}
        disabled={props.disabled}
      />
      </label>
    </React.Fragment>
  );
};

export default InputStar;
